import React, { useState } from "react";
import "../request/Request.scss";

const Request = () => {
  const [currentStep, setCurrentStep] = useState(0);
  const steps = [
    { title: "Fish Details", subtitle: "Enter information about Fish" },
    { title: "Auction Method", subtitle: "Choose the auction method" },
    { title: "Auction Detail", subtitle: "Provide auction details" },
    { title: "Preview", subtitle: "Preview your request" },
  ];
  const filedsets = [
    {
      title: "Fish Details",
      content: (
        <div class="fieldInput">
          <div class="col-md-6 inputBox">
            <h5>Fish Name</h5>
            <input type="text" name="fishName" placeholder="Fish Name" />
          </div>
          <div class="col-md-6 inputBox">
            <h5>Fish Name</h5>
            <input type="text" name="FishShape" placeholder="Fish Shape" />
          </div>
        </div>
      ),
    },
    {
      title: "Auction Method",
      content: (
        <div className="fieldInput">
          <div className="col-md-6">
            <h5>Fish Name</h5>
            <input type="text" name="fishName" placeholder="Fish Name2" />
          </div>
          <div className="col-md-6">
            <h5>Fish Shape</h5>
            <input type="text" name="FishShape" placeholder="Fish Shape2" />
          </div>
        </div>
      ),
    },
    {
      title: "Auction Detail",
      content: (
        <div className="fieldInput">
          <div className="col-md-6">
            <h5>Fish Name</h5>
            <input type="text" name="fishName" placeholder="Fish Name2" />
          </div>
          <div className="col-md-6">
            <h5>Fish Shape</h5>
            <input type="text" name="FishShape" placeholder="Fish Shape2" />
          </div>
        </div>
      ),
    },
    {
      title: "Preview",
      content: (
        <div className="fieldInput">
          <div className="col-md-6">
            <h5>Fish Name</h5>
            <input type="text" name="fishName" placeholder="Fish Name2" />
          </div>
          <div className="col-md-6">
            <h5>Fish Shape</h5>
            <input type="text" name="FishShape" placeholder="Fish Shape2" />
          </div>
        </div>
      ),
    },
  ];
  const handleNext = () => {
    if (currentStep < steps.length - 1) {
      setCurrentStep(currentStep + 1);
    }
  };

  const handlePrevious = () => {
    if (currentStep > 0) {
      setCurrentStep(currentStep - 1);
    }
  };

  return (
    <div className="request-form">
      <div className="header"></div>

      <div className="row">
        <div className="col-md-6 col-md-offset-3">
          <form className="request">
            <ul className="progressbar">
              {steps.map((step, index) => (
                <li
                  key={index}
                  className={index <= currentStep ? "active" : ""}
                >
                  {step.title}
                </li>
              ))}
            </ul>

            {steps.map((step, index) => (
              <fieldset
                key={index}
                style={{ display: index === currentStep ? "block" : "none" }}
              >
                <h2 className="fs-title">{step.title}</h2>
                <h3 className="fs-subtitle">{step.subtitle}</h3>

                {/* Example field input */}
                {filedsets[index]?.content}

                <div className="action-buttons">
                  {index > 0 && (
                    <button
                      type="button"
                      className="previous action-button-previous"
                      onClick={handlePrevious}
                    >
                      Previous
                    </button>
                  )}
                  {index < steps.length - 1 ? (
                    <button
                      type="button"
                      className="next action-button"
                      onClick={handleNext}
                    >
                      Next
                    </button>
                  ) : (
                    <input
                      type="submit"
                      name="submit"
                      className="submit action-button"
                      value="Submit"
                    />
                  )}
                </div>
              </fieldset>
            ))}
          </form>
        </div>
      </div>
    </div>
  );
};

export default Request;
